DROP TABLE IF EXISTS `basic_error_info`;
CREATE TABLE `basic_error_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) COMMENT '创建时间',
  `update_time` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3) COMMENT '更新时间',
  `create_user` varchar(255) DEFAULT NULL COMMENT '创建用户',
  `update_user` varchar(255) DEFAULT NULL COMMENT '更新用户',
  `state` varchar(255) NOT NULL COMMENT '有效状态',
  `module` varchar(255) NOT NULL COMMENT '所属模块-RMS、RSS、RTS等',
  `error_code` varchar(32) NOT NULL COMMENT '错误码',
  `level` int(11) NOT NULL COMMENT '错误级别',
  `solution` varchar(1024) DEFAULT NULL COMMENT '解决方案',
  `alarm_detail` varchar(255) DEFAULT NULL COMMENT '告警详情',
  `alarm_module` varchar(255) NOT NULL COMMENT '告警模块',
  `alarm_name` varchar(255) DEFAULT NULL COMMENT '告警名称',
  `alarm_type` varchar(255) NOT NULL COMMENT '告警分类',
  `warning_spec` varchar(255) NOT NULL COMMENT '告警分类',
  `need_update` bit(1) NOT NULL COMMENT '是否需要被更新',
  `alarm_way` varchar(255) DEFAULT NULL COMMENT '告警方式（钉钉、微信）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `receiver` varchar(255) DEFAULT NULL COMMENT '告警收件人',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_error_code` (`error_code`)
