INSERT INTO `basic_error_info` VALUES ('392', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0301', '4', '一旦AGV进入危险模式，需要断电重启AGV。如果重启后仍然会出现“处于危险模式”的状态，则需要排查具体原因。\n    快速恢复方法：断电重启。', '由于48V断电或者驱动器超时等原因导致系统进入危险模式。', 'robot', '系统处于危险模式', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('393', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0302', '3', '“托盘寻零”指令允许托盘顶升。', '在指令号12号“托盘寻零”指令中规定托盘不允许顶升时（下发指令参数为0），此时托盘处于顶升状态，会报0x302号错误。', 'robot', '托盘顶升状态无法寻零位', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('394', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0303', '3', '1、排查充电口过温原因\n    2、适当调节过温阈值，通过111号参数', '在AGV充电过程中，如果读取充电口温度超过阈值（111号参数决定），并且累计超过一定次数（默认10次），AGV就会关闭充电口，并且报0x303错误。', 'robot', '充电温度过高', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('395', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0304', '3', '1）检查设置失败原因；2）第2）种情况，对于没有更新固件的电池，为了防止通信不上报错，可以将动态电流阈值（36号参数）调大，从而屏蔽该报错。', '1）指令执行前检测会设置电池过流参数，如果设置失败报0x304错误；2）设置静态电流时，动态电流阈值过低，会报0x304错误', 'robot', '设置电池保护参数失败', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('396', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0305', '3', '1、排查导致充电电流过大的原因\n    2、适当调节过温阈值，通过36号参数', '在充电过程中，电池电流检测到电流超过阈值（36号参数决定），并且累计超过一定次数（默认1次），AGV就会关闭充电，并且报0x305号错误。', 'robot', '电池充电电流过大', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('397', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.327', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0306', '3', '1、排查导致充电电流过大的原因\n    2、适当调节过温阈值，通过36号参数', '当至少一个电机的指令速度大于0时，电池电流检测到电流超过阈值（36号参数决定），并且累计超过一定次数（默认1次），会停车并报0x306号错误。', 'robot', '电池动态电流过大', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('398', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.328', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0307', '3', '1、排查导致充电电流过大的原因\n    2、适当调节过温阈值，通过36号参数', '当所有电机的指令速度均为0时，电池电流检测到电流超过阈值（36号参数决定），并且累计超过一定次数（默认1次），会报0x307号错误。', 'robot', '电池静态电流过大', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('399', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.279', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0308', '3', '1、排查导致静态电流累计过大的原因\n    2、适当调整176号参数', '当驱动器电流超出正常范围后（176号参数和驱动器工作模式共同决定，一般为0.5A-1.0A），对差值进行积分，并对积分值进行判断，当该积分电流超出一定阈值时（176号参数决定），报0x0308号错误。', 'robot', '驱动器静态电流累计过大', 'robot', 'dsp', '\0', 'centerControl', null, null);
