INSERT INTO `basic_error_info` VALUES ('441', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.285', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0507', '3', '如果货架防撞角度偏差容忍阈值过小，或者现场允许情况下，可以适当调大68号参数', '执行货架顶升或下降时，货架对地角度（全局坐标系下）与其最接近的x轴正负方向或y轴正负方向（即角度0,pi/2,pi,3*pi/2）差别太大，大于货架防撞角度偏差容忍阈值。', 'robot', '托盘角度校正过大', 'robot', 'dsp', '\0', 'centerControl', null, null);
