INSERT INTO `basic_error_info` VALUES ('446', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0603', '3', '126号参数调节开启哪些避障', '在执行移动或者旋转指令的时候，会判断相应的避障区域（前/后/左/右/周围）是否注册以及避障是否开启。如果相应避障开启但是区域没有被注册，则会报错。另外，避障区域是否注册是按车型划分的。', 'robot', '避障区域失效', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('447', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.285', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0604', '3', '检查3号参数设置是否合理。', '停车时需要对左、右轮速度分别进行确认，当两者均小于最小爬行速度（由3号参数决定）时，将小车的运动状态切换为停止状态。若无法确认双侧速度小于最小爬行速度则计数，连续计数500次后报0x0604错误。', 'robot', '停车状态确认超时', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('448', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0605', '3', '清错后重新进入充电', '充电过程中，当小车电量大于95%时，关闭接触器，断开充电。由于小车自身耗电，当电量低于80%后重新闭合接触器进行充电，如此循环三次后，将报0x0605号错误。', 'robot', '充电接触器开关超过三次', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('449', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0701', '3', '清错，观察确认叉臂伸缩回到零位', '当料箱机器人即将执行移动、旋转、叉臂升降、叉臂旋转时，若检测到当前叉臂伸出超过0.01m，则报0x0701错误。', 'robot', '料箱机器人插臂伸出', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('450', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0702', '3', '1）清错可恢复，既为偶发通讯延迟导致的解码超时\n    2）清错不可恢复，检查解码进程是否在运行，如果程序没有运行找智驾图像组查看程序没有运行的原因\n    3）清错不可恢复，ping192.168.222.220不通或延迟严重，既为ARM板和767的网口通讯有问题，需要找嵌入式组查看\n    4）清错不可恢复，ping相机的IP地址不通，既为相机和ARM板无法通讯，先检查线束连接，以及IP地址配置，如果都没有问题找嵌入式组查看', '料箱机器人侧视摄像头解码超时，报0x0703号错误', 'robot', '料箱机器人解码超时', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('451', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0703', '3', '清错，查看是否是由空货架取货，或者向满货架放货导致的报错', '料箱机器人侧视摄像头解码失败时（一般系指令需求解码数于实际解码数不相符），报0x0703号错误', 'robot', '料箱机器人解码失败', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('452', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x0709', '3', '首先查看下位机参数配置与实际工况是否相符，参数号213，参数形式EFCBA，具体解释如下：\n    A(0：禁用深度纠偏数据 1：启用深度纠偏数据） \n    B(0：关闭带载检测 1：打开带载检测） \n    C(0：一次定位纠偏策略 1：二次定位纠偏策略） \n    D（解码报错模式选择，0：解双码料箱码纠偏，1：解单码货架码纠偏，2：解双码货架码纠偏） \n    E（是否创建tcp日志传输，0不创建，1创建）', '料箱机器人图像太亮', 'robot', '料箱机器人图像太亮', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('453', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x070A', '3', '1、联系技术支持', '料箱车：料想车解码失败', 'robot', '料箱机器人无法取货', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('454', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x070B', '3', '寻零动作由上位机发，遇到这种情况需要下线－〉一键启动－〉上线；若还是不行则下线－〉重置－〉一键启动－〉上线；但为什么不执行寻零动作需要由上位机人员确认；', '车辆报错51号是车辆的插臂未完成寻零动作导致', 'robot', '料箱机器人插臂未寻零', 'robot', 'dsp', '\0', 'centerControl', null, null);
INSERT INTO `basic_error_info` VALUES ('455', '2022-08-02 10:10:10.392', '2023-03-05 10:58:34.286', 'excel_sync', 'excel_sync', 'effective', 'DSP', 'DSP0x070C', '3', 'A(0：禁用深度纠偏数据 1：启用深度纠偏数据） \n    B(0：关闭带载检测 1：打开带载检测） \n    C(0：一次定位纠偏策略 1：二次定位纠偏策略） \n    D（解码报错模式选择，0：解双码料箱码纠偏，1：解单码货架码纠偏，2：解双码货架码纠偏） \n    E（是否创建tcp日志传输，0不创建，1创建）\n    备注：\n    8103.70.1303版本之前C(0：纠偏不采用料箱码 1：纠偏采用料箱码） D（解码报错模式选择，0：解双码，1：仅解货架码）\n    如果采用二次定位纠偏策略，参数位D必须是0：\n    在参数无问题情况下需要查看存图，依据存图和工况来判断问题', '1.下位机213号参数和实际工况不匹配\n    2.指令需求和实际场景对不上，例如去货位取货但实际货位并无货', 'robot', '料箱机器人，超出纠偏范围', 'robot', 'dsp', '\0', 'centerControl', null, null);
